import React from "react";

import { FullPageVideo } from '../common/FullPageVideo';

import video from '../../img/dc.mp4';

class QuizPageMain extends React.Component {
    render() {
        return (
            <>
                <FullPageVideo video={video} />
            </>
        )
    }
}

export default QuizPageMain;
